INSERT INTO ville VALUES (1,'Lille','lille',2,2,NULL,'Le <a href=\"http://clx.anet.fr\">CLX</a> (Club LinuX Nord Pas de Calais) organise tous les mois trois rencontres, qui sont les mardi-linux.<p>\r\nA Lille cela se passe le deuxième mardi de chaque mois, pour connaitre l\'heure et le lieu de la rencontre rendez-vous sur le <a href=\"http://clx.anet.fr\">site web du CLX</a>.',NULL);
INSERT INTO ville VALUES (2,'Paris','paris',1,4,NULL,'<table width=\"100%\" bgcolor=\"#cFcFcF\" border=\"0\" cellspacing=\"0\" cellpadding=\"3\" class=\"text\">\r\n<tr><td>\r\n<p>Depuis le 4 mai 2000 les utilisateurs de <a href=\"http://www.gnu.org/philosophy/free-sw.fr.html\">logiciel libre</a> et de <a href=\"http://www.gnu.org/gnu/linux-and-gnu.fr.html\">GNU/Linux</a>, <a href=\"http://www.gnu.org/software/hurd/hurd.html\">Hurd</a>, *BSD et tous les systèmes libres se retouvent tous les premier jeudi de chaque mois pour boire un verre, manger un morceaux et surtout discuter de vive voix.\r\n</p>\r\n\r\nCette réunion se tient à Paris &agrave <b>La Taverne des Halles, 12 rue de la Cossonerie</b> (75001), métro Chatelets les Halles . Le rendez-vous est fixé à 20h00, mais vous pouvez arriver tout au long de la soirée.<br>La Taverne des Halles se trouve a 50m du Hall\'s Beer, l\'ancien lieu des firstjeudi.<p>\r\nTous les utilisateurs de logiciel libre sont les bienvenus (*BSD, Hurd, Linux, etc) ainsi que toutes les associations.\r\n<p>\r\n\r\nPour l\'instant les associations/groupes qui \"parrainent\" cette bouffe sont :<p>\r\n\r\n&nbsp;-&nbsp; <a HREF=\"http://www.april.org/\">April</a><br>\r\n&nbsp;-&nbsp; <a HREF=\"http://www.linuxfr.org/\">LinuxFR</a><br>\r\n&nbsp;-&nbsp; <a HREF=\"http://www.lolix.org/\">Lolix</a><br>\r\n&nbsp;-&nbsp; <a HREF=\"http://www.parinux.org/\">Parinux</a><br>\r\n<p>\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.\r\n</td></tr>\r\n</table>\r\n\r\n',NULL);
INSERT INTO ville VALUES (3,'Auray','auray',3,3,NULL,'Le SGEG (Sansten GNU Easy Group) vous invite tous les <b>3 ème mercredi</b> de chaque mois au SGEG Meeting pour discuter de <a href=\"http://www.gnu.org/philosophy/free-sw.fr.html\">logiciel libre</a>, boire un verre, manger un morceau et surtout se rencontrer !\r\n<p>\r\nCette réunion se tient à <a href=\"http://saint-goustan.net/SPIP/\">Saint-Goustan</a>, Port d\'Auray chez <b><a href=\"http://saint-goustan.net/SPIP/article.php3?id_article=3\">Ti Morganez</a></b>, 13 quai Benjamin Franklin. Le rendez-vous est fixé à 20h00, mais vous pouvez arriver tout au long de la soirée.<br>\r\nTous les utilisateurs de logiciel libre sont les bienvenus (*BSD, Hurd, Linux, etc) ainsi que toutes les associations, les utilisateur(trice)s pas avertis sont aussi les bienvenus.\r\n<p>\r\nPrévoir une participation culinaire de 10 euros (hors boissons), nous sommes dans un restaurant.\r\n<p>\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.\r\n<p>\r\nAttention, il faut s\'inscrire <b>tous les mois</b> !',NULL);
INSERT INTO ville VALUES (4,'Aix en Provence','aix-en-provence',4,3,NULL,'L\'<a href=\"http://www.axul.org/\">Axul</a>, organise des réunions tous les mois pour discuter de logiciel libre et de GNU/Linux autour d\'un verre et d\'un bon plat.\r\n<p>\r\nLe lieu pouvant varier à chaque manifestation nous vous invitons à consulter la <a href=\"http://www.axul.org/reunion.html\">page</a> annoncant les réunions sur leur site.\r\n<p>\r\nLes utilisateurs pas avertis sont aussi les bienvenus.\r\n<p>\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.',NULL);
INSERT INTO ville VALUES (5,'Bordeaux','bordeaux',2,4,NULL,'L\'<a href=\"http://www.abul.org/\">Abul</a> vous donne rendez-vous tous les second jeudi de chaque mois au Middle Jeudi pour discuter de <a href=\"http://www.gnu.org/philosophy/free-sw.fr.html\">logiciel libre</a>, boire un verre, manger un morceau et surtout se rencontrer !\r\n<p>\r\n\r\nLe rendez-vous est fixé à 20H :<p>\r\n\r\nAu Pub \"The Frog et Rosbif\"<br>\r\n23 r Ausone (33000 Bordeaux)<br>\r\nAttention, ils brassent eux-même leurs bières !<br>\r\n<ul>\r\n<li><a href=\"http://www3.mappy.com/sidt9x0ITqgGjt5Xg8o/Z?out=2;xsl=5;evolved=0;a=214253\">Plan</a>\r\n</ul>\r\n\r\n<p>\r\nEmmenez un tux ou un linux mag, la dernière fois, certains étaient à un mètre les uns des autres sans se reconnaître !\r\n</p>\r\n<br>\r\nTous les utilisateurs de logiciel libre sont les bienvenus (*BSD, Hurd, Linux, etc) ainsi que toutes les associations.\r\n<p>\r\n\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.\r\n<p>\r\nAttention, il faut s\'inscrire <b>tous les mois</b> !',NULL);
INSERT INTO ville VALUES (6,'Montpellier','montpellier',5,4,NULL,'\r\nL\'<a href=\"http://www.lastjeudi.org/\">ALL</a> (Association pour le Logiciel Libre), vous attends à Montpellier le dernier jeudi de chaque mois. Le rendez-vous est fixé à 20h00 à la Brasserie du Triolet, 34 Avenue Emile Diacon, à coté de la cité U du Triolet.\r\n\r\n<p>\r\n\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.\r\n\r\n\r\n',NULL);
INSERT INTO ville VALUES (7,'Lyon','lyon',4,1,NULL,'Tous les jeudis l\'<a href=\"http://www.aldil.org/\">ALDIL</a> vous donne rendez-vous à Lyon pour discuter et boire un verre.</p>\r\n\r\n<p>\r\nDepuis 2 ans maintenant les lyonnais se retrouvent au <a href=\"http://libnetcafe.org/hometaxi/libre.html\">Home-Taxi</a>, 138 avenue Félix Faure Lyon 03, tous les jeudis pour des discussions libres autour d\'un bon repas. Si vous souhaitez vous aussi discuter de logiciel libre, GNU/Linux et autres, rendez-vous vers 19h00 avec les membres de l\'Aldil.\r\n</p>\r\n\r\n<p>\r\nAfin d\'évaluer approximativement le nombre de personnes qui viendront, nous vous demandons de bien vouloir vous inscrire par l\'intermédiaire du formulaire suivant.</p>\r\n\r\n',NULL);
INSERT INTO ville VALUES (8,'Dunkerque','dunkerque',3,2,NULL,'Le <a href=\"http://clx.anet.fr\">CLX</a> (Club LinuX Nord Pas de Calais) organise tous les mois trois rencontres, qui sont les mardi-linux.<p>\r\nA Dunkerque cela se passe le troisième mardi de chaque mois, pour connaitre l\'heure et le lieu de la rencontre rendez-vous sur le <a href=\"http://clx.anet.fr\">site web du CLX</a>.',NULL);
INSERT INTO ville VALUES (9,'Douai','douai',4,2,NULL,'\r\nLe <a href=\"http://clx.anet.fr\">CLX</a> (Club LinuX Nord Pas de Calais) organise tous les mois trois rencontres, qui sont les mardi-linux.<p>\r\nA Douai cela se passe le quatrième mardi de chaque mois, pour connaitre l\'heure et le lieu de la rencontre rendez-vous sur le <a href=\"http://clx.anet.fr\">site web du CLX</a>.',NULL);
INSERT INTO ville VALUES (10,'Digne','digne',3,3,NULL,'L\'association <a href=\"http://linux-alpes.org/\">linux-alpes</a> organise des rencontres à Dignes tous les 3eme mercredi de chaque mois.',NULL);
INSERT INTO ville VALUES (11,'Veynes','veynes',4,3,NULL,'Tous les 4 èmes mercredi de chaque mois vous êtes attendu à Veynes pour dicuter de logiciel libre avec les membres de l\'association <a href=\"http://www.linux-alpes.org/\">Linux Alpes</a>.',NULL);
INSERT INTO ville VALUES (12,'Rennes','rennes',2,3,NULL,'Tous les deuxièmes mercredi du mois, venez-donc boire un verre avec les membres de <a href=\"http://gulliver.eu.org/\">Gulliver</a> ainsi que les autres amateurs de libre de Rennes !\r\n<p>\r\nLa rencontre aura lieu à la Taverne du Haut\r\nGrimoire le mercredi 9 Octobre à partir de 20h45.\r\n<p>\r\n',NULL);
INSERT INTO ville VALUES (14,'Genève','geneve',2,4,NULL,'<a href=\"http://www.com-plex.ch/lallg/\">lallg</a>\r\norganise le deuxième jeudi \r\nde chaque mois une bouffe\r\net chaque jeudi une petite\r\nréunion autour d\'un verre \r\npour parler de logiciel \r\nlibre.\r\n<p>\r\nCes reunions ont lieu au :<br>\r\n\"Le Tortelino\"<br>\r\n21 Av. du Mail<br>\r\n1205 Genève',NULL);
INSERT INTO ville VALUES (13,'La Rochelle','larochelle',1,4,NULL,'Face à la mer ! Oui c\'est dans ce cadre plus que sympathique que les membres du Rochelug vous attendent à la Rochelle pour discuter de logiciel libre.\r\n<p>\r\nRendez-vous au Roll\'s, promenade de la concurrence, face à la plage de la concurrence.\r\n<p>\r\nPlus d\'info sur <a href=\"http://lug.larochelle.tuxfamily.org/\">http://lug.larochelle.tuxfamily.org/</a>',NULL);
INSERT INTO ville VALUES (15,'Caen','caen',1,4,NULL,'Les jeudis du libre à Caen se déroulent le premier jeudi de chaque mois au O\'Donnell\'s Pub à partir de 19h00 et sont organisés par l\'association <a href=\"http://www.calvix.org/\">CaLviX</a>.',NULL);
INSERT INTO ville VALUES (16,'Amiens','amiens',1,5,NULL,'Les éleveurs de pingouins picards se réunissent tous les premiers vendredi de chaque mois à Amiens autour d\'un verre pour discuter de vive voix des projets en cours, et de l\'organisation des futurs événements. Plus d\'infos sur : <a href=\"http://www.epplug.org/\">www.epplug.org</a>',NULL);
